  `type` varchar(45) DEFAULT NULL,
  `quantity` int DEFAULT '0',
  `sold` int DEFAULT '0',
  `rate` float DEFAULT '0',
  `total_rate` int DEFAULT '0',
  `created_date` timestamp NULL DEFAULT NULL,
  `modified_date` timestamp NULL DEFAULT NULL,
