INSERT INTO `product` VALUES (143,'Áo thun thể thao Nike Nam','aothunthethaonikenam','DQ1052-100',5865000.00,0,490000.00,'Nhờ chất liệu vải cotton nhẹ và vừa vặn cổ điển, Áo thun thể thao của Nike dễ dàng được yêu thích như đồ mới và giày thể thao.','<p><strong>KHÔNG BAO GIỜ KHÔNG TƯƠI.</strong></p><p><br>&nbsp;</p><p>Nhờ chất liệu vải cotton nhẹ và vừa vặn cổ điển, Áo thun thể thao của Nike dễ dàng được yêu thích như đồ mới và giày thể thao.</p><p><br>&nbsp;</p><p><strong>Lợi ích</strong></p><ul><li>Kiểu dáng tee cổ điển phù hợp với cơ thể và hông tạo cảm giác thoải mái.</li><li>Vải cotton hàng ngày cho cảm giác mềm và nhẹ.</li></ul><p><br>&nbsp;</p><p><strong>Thông tin chi tiết sản phẩm</strong></p><ul><li>100% chất liệu cotton</li><li>Máy giặt</li><li>Đã nhập khẩu</li><li>Màu sắc hiển thị: Trắng</li><li>Phong cách: DQ1052-100</li><li>Quốc gia / Khu vực xuất xứ: Ai Cập</li></ul>',22,1,NULL,'https://firebasestorage.googleapis.com/v0/b/san-ho-do-an-dai-duong.appspot.com/o/f07e8212-a319-40dd-9c56-3ee7077b0c31.webp?alt=media',1,'NORMAL',22,5,4,2,NULL,'2022-06-19 09:52:16',NULL,NULL),(144,'Áo thun thể thao Nike Nam (size M - màu Trắng)','aothunthethaonikenam(sizem-mautrang)','DQ1052-100',586500.02,0,490000.00,'Nhờ chất liệu vải cotton nhẹ và vừa vặn cổ điển, Áo thun thể thao của Nike dễ dàng được yêu thích như đồ mới và giày thể thao','<p>Nhờ chất liệu vải cotton nhẹ và vừa vặn cổ điển, Áo thun thể thao của Nike dễ dàng được yêu thích như đồ mới và giày thể thao</p>',22,1,143,'https://firebasestorage.googleapis.com/v0/b/san-ho-do-an-dai-duong.appspot.com/o/729fa437-7cdd-4a71-a639-937d3ed387ee.webp?alt=media',1,'NORMAL',7,2,0,0,NULL,NULL,NULL,NULL),(145,'Áo thun thể thao Nike Nam (size L - màu Trắng)','aothunthethaonikenam(sizel-mautrang)','DQ1052-100',586500.02,0,490000.00,'Nhờ chất liệu vải cotton nhẹ và vừa vặn cổ điển, Áo thun thể thao của Nike dễ dàng được yêu thích như đồ mới và giày thể thao','<p>Nhờ chất liệu vải cotton nhẹ và vừa vặn cổ điển, Áo thun thể thao c