lyester</li><li>Máy giặt</li><li>Đã nhập khẩu</li><li>Màu sắc hiển thị: Đen / trắng</li><li>Phong cách: DM7780-010</li><li>Quốc gia / Khu vực xuất xứ: Việt Nam, Sri Lanka</li></ul>',12,1,NULL,'https://firebasestorage.googleapis.com/v0/b/do-an-dai-duong-2.appspot.com/o/7049ed6e-ff02-46ca-8668-ddf584769f2a.webp?alt=media',1,'NORMAL',3,0,0,0,'2022-06-21 00:41:07','2022-06-21 02:04:23',NULL,NULL),(385,'Áo ba lỗ nữ Nike Swoosh Run (size M - màu đen)','aobalonunikeswooshrun(sizem-mauden)','DM7780-010',869000.00,0,469000.00,'Là một sản phẩm được yêu thích đa năng, Nike Swoosh Run Tank được thiết kế để chạy ở mọi độ dài. Chất liệu vải mềm, mịn có hình dạng thoáng khí giúp bạn luôn khô ráo và thoáng mát. Sản phẩm này được làm từ 100% sợi polyester tái chế.','<p>Là một sản phẩm được yêu thích đa năng, Nike Swoosh Run Tank được thiết kế để chạy ở mọi độ dài. Chất liệu vải mềm, mịn có hình dạng thoáng khí giúp bạn luôn khô ráo và thoáng mát. Sản phẩm này được làm từ 100% sợi polyester tái chế.</p><p><br>&nbsp;</p><p><strong>Đại diện cho Swoosh</strong></p><p>Đây là những người chạy bộ đang thực hiện những bước đầu tiên hướng tới mục tiêu của họ. Bộ sưu tập Swoosh Run xuất hiện với tất cả các mục yêu thích chạy bộ của chúng tôi, với các chi tiết mới tạo thêm sức sống cho logo Nike. Thể hiện và thể hiện ra ngoài — thời gian để chạy.</p><p><br>&nbsp;</p><p><strong>Đổ mồ hôi</strong></p><p>Thiết kế thoáng khí với Công nghệ Nike Dri-FIT di chuyển mồ hôi ra khỏi cơ thể để bay hơi nhanh hơn, giúp bạn luôn khô ráo và thoáng mát.</p><p><br>&nbsp;</p><p><strong>Di chuyển trong sự thoải mái</strong></p><p>Vải mềm, mịn uốn cong xuống ở viền sau để tạo cảm giác vừa vặn và che phủ nhiều hơn một chút. Thiết kế racerback và các khe nhỏ ở hai bên tạo thêm cảm giác khi bạn di chuyển.</p><p><br>&nbsp;</p><p><strong>Thông tin chi tiết sản phẩm</strong></p><ul><li>100% polyester</li><li>Máy giặt</li><li>Đã nhập khẩu</li><li>Màu sắc hiển thị: Đen / trắng</li><li>Phong cách: DM7780-010</li><li>Quốc g